import './ExpensesList.css';

const ExpensesList = (props) => {
    return (<ul>
        filteredExpenses.map((expense => (
        <ExpenseItem
            key={props.items.id}
            title={props.items.title}
            amount={props.items.amount}
            date={props.items.date}>
        </ExpenseItem>
        )
        ))
    </ul>)
}

export default ExpensesList;
